let container = {
  maxWidth: "65vw",
  margin: "0 0 0 10px"
}

let searchInput = {
  width: "100%",
  height: "30px",
  margin: "0 0 0 10px",
  outlineWidth: "0px",
  boxSizing: "border-box",
  fontSize: "17px",
}

let listContainer = {
  marginTop: "10px",
  height: "84vh", 
  overflowY: "scroll",
  overflowX: "hidden"
}

export {
  container,
  searchInput,
  listContainer
}
